import React from 'react';
import moment from 'moment';
import * as timeManipulations from '../api/api';

export default class TimeTesting extends React.Component {


    render() {
        let lowerPlaceholder = moment(Date.now()).subtract(7,'days');
        let lowerBound = moment.set({
            'year': lowerPlaceholder.get('year'),
            'date': lowerPlaceholder.get('date'),
            'hour':6,
            'minute':0,
            'second':0,
            'millisecond':0
        });
        console.log(lowerPlaceholder);
        console.log(lowerBound);
        // console.log(lowerPlaceholder.get("date"));








        return (
            <div>
                time tester
            </div>
        );
  }
}
